import React from 'react';
import { Container, Header, HeaderContent } from './styles';
import logoImg from '../../assets/logo.svg';


const Dashboard: React.FC = () => {
  return (
    <Container>
      <Header>
        <HeaderContent>
          <img src={logoImg} alt="GoBarber" />
        </HeaderContent>
      </Header>
    </Container>
  );
};

export default Dashboard;
